	(55, '5d97cae6a7c4693372dd9c39', 12, 186, 'The contrast between Mellody Farm and the Elizabethan-style Ardleigh, designed in 1896 for the John V. Farwell Jr. family, showcases Heun’s range.', 2, '', '2023-01-25 22:21:58', '2023-01-25 22:21:58'),
