	(876, '5da8f3b28303b310c1d6e623', 104, 1113, 'The 1896 Ferry Hall women’s basketball team.', 0, '', '2023-01-25 22:21:58', '2023-01-25 22:21:58'),
	(877, '5da8f3b28303b310c1d6e625', 104, 1114, 'The first two games took place at Mitchell Hall’s home court, the Gymnasium, now Hotchkiss Hall. Mitchell Hall refused to play in Ferry Hall’s gym, citing the unfit playing conditions: the Ferry Hall gym ceilings were too low for regulation baskets, and a row of posts ran through the center of the court.', 2, '', '2023-01-25 22:21:58', '2023-01-25 22:21:58'),
	(878, '5da8f3b28303b310c1d6e627', 104, 1115, 'Ferry Hall’s inadequate gymnasium conditions for basketball is probably why the team began practicing on the “basket ball field” outdoors, pictured here in one of the school’s viewbooks.', 4, '', '2023-01-25 22:21:58', '2023-01-25 22:21:58'),
